  [],\n\t\"revision_timestamp\": \"2015-05-07T06:15:21.393870\",\n\t\"name\": \"gpm-gmi-level-1a-unpacked-packet-data-vv02a\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The strength of the 1AGMI product is that
  it has unaltered data straight from the satellite. This product can be used to show
  exactly what was recorded by the GMI instrument. The 1AGMI product also contains
  all of the data sent down by the satellite. If there is enough bandwidth, the entire
  circle of GMI samples will be sent down. The 1AGMI product's swaths 4 and 5 contain
  all of the samples that are sent down. Later products only use the subset of these
  data that contains the Earth view, hot load, and cold sky samples.The 1AGMI product
  has two purposes: To repackage the raw satellite data from binary Consultative Committee
  for Space Data Systems (CCSDS) packets to Hierarchical Data Format (HDF), and to
  geolocate the sample data. The counts in the 1AGMI product are the raw counts taken
  directly from the packets created by the GPM Microwave Imager (GMI) instrument.
  There is no calibration or interpretation performed at the 1AGMI level. There are
  five swaths in the 1AGMI product: 1. Earth view, hot load, and cold sky samples
  for low-frequency channels. 2. Earth view, hot load, and cold sky samples for high-frequency
  channels. 3. Scan housekeeping data provided by instrument. 4. All samples for low-frequency
  channels. 5. All samples for high-frequency channels. Swaths S1 and S2 are subsets
  of swaths S4 and S5, respectively. The samples to subset are noted in the 1AGMI
  product in the gmi1aHeader/sampleRangeFile table. This is a table determined during
  testing and the Launch and Early Orbit (L&EO) phase of the Global Precipitation
  Measurement (GPM) Mission. Geolocation is performed on the samples using the PPS
  Geolocation Toolkit. The details on GMI geolocation can be found in the GMI Calibration
  Data Book.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
